export default function VolunteerDashboard(){
    const eventName = ['abc', 'cba']
    return(
        <div>
            <h1>Volunteer Dashboard</h1>
            <ul>
                {eventName.map((name, index) => (
                <li key={index}>{name}</li>
                ))}
            </ul>
        </div>
    );
}
